import Head from "next/head";
import Link from "next/link";
import { useEffect } from "react";
import { useRouter } from "next/router";

import Nav from "./nav";

const header = () => {
    const router = useRouter();
    useEffect(() => {
        
    });

    return (
        <header className="d-flex align-items-center fs-2 text-white">
            <div className="header__logo flex-center col-2">
                <img className="pointer" src="/images/logo/logo.png" alt=""/>
            </div>
            <div className="header__nav h-100">
                <Nav></Nav>
            </div>
            <div className="header__search flex-center">
                <input type="text" className="form-control"/>
                <button onClick={() => router.push('/')}>검색</button>
            </div>
            <div className="header__login d-flex align-items-center pointer">
                <img src="data:image/png;base64," alt=""/>
            </div>
        </header>
    );
};

export default header;
